import React, {Component} from "react";

class Login extends Component{
    constructor(props) {
        super(props);
        this.state = {value: '',
        username:'',
        password:''};

        //this.handleChange = this.handleChange.bind(this);
        this.handlePassword=this.handlePassword.bind(this);
        this.handleUsername=this.handleUsername.bind(this);
        this.handlereg=this.handlereg.bind(this);
        this.handlelogin=this.handlelogin.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleValue(event) {
        this.setState({value: event.target.value});
    }

    handleUsername(event) {
        this.setState({username: event.target.value});
    }

    handlePassword(event) {
        this.setState({password: event.target.value});
    }

    handlelogin(event) {
        //this.setState({value: event.target.value});
        alert("login")
        event.preventDefault()
    }
    handlereg(event) {
        //this.setState({value: event.target.value});
        alert("register")
        event.preventDefault()
    }

    render() {
        return (
            <form>
                <label>
                    Login type:
                    <select value={this.state.value} onChange={this.handleValue}>
                        <option value="customer">Customer</option>
                        <option value="partner">Partner</option>
                        <option value="delivery">Delivery</option>
                    </select>
                </label>
                <label>Username</label>
                <input type="text" name="username" value={this.state.username} onChange={this.handleUsername}/>
                <label>Password:</label>
                <input type="password" name="password" value={this.state.password} onChange={this.handlePassword}/>
                <input type="submit" value="Login" onChange={this.handlelogin}/>
                <input type="submit" value="New user?Register" onChange={this.handlereg} />
            </form>
        );
    }
}
export default Login
